import { Fragment } from "react";
import { useParams } from "react-router-dom";

const QuoteDetail = () => {

  const params = useParams();

  return ( 
    <Fragment>
      <p>{params.qutoeId}</p>
      <h1>Quote Detail Page</h1>
    </Fragment>
  );
}

export default QuoteDetail;
